import React, { Component } from 'react'
import socketIOClient from 'socket.io-client'
import Cookies from 'universal-cookie'


const cookies = new Cookies()
cookies.set('name', 'chinh', {path: '/'})
const serverUrl = 'http://192.168.1.4:3001/'


class StartBttn extends Component{

    state = {
        ifAdmin: null
    }


    componentDidMount(){
        cookies.set('username', this.props.username, { path: '/' })
        const socket = socketIOClient(serverUrl + 'handle-cookies', {
            query: {
                roomid: this.props.roomid,
                username: this.props.username
            }
        })

        socket.on('GetCookies', data => console.log(data))
    }

    render(){
        return(
            <>
                <button type='button' >test cookies</button>
            </>
        )
    }
}

export default StartBttn
